import React from "react";
import { Container, List, Elements, Links, Wrapper } from "./NavBarStyle";
const NavBar = () => {
    return (
        <Wrapper>
            <Container>
                <List>
                    <Elements>
                        <Links href="#home">Home</Links>
                    </Elements>
                    <Elements>
                        <Links href="#sobre">Sobre</Links>
                    </Elements>
                    <Elements>
                        <Links href="#api">Api's</Links>
                    </Elements>
                </List>
            </Container>
        </Wrapper>
    );
};

export default NavBar;
